import React, { Component, useState } from 'react';
import {View} from 'react-native';
import { Agenda } from 'react-native-calendars';
import './App.css';

const App = () => {
    const [items, setItems] = useState([]);

    return <View>

        <Agenda
        items={items}
        loadItemsForMonth={loadItems}
        selected={'2017-05-16'}
        />

    </View>
}

export default App;
